import React from "react";
import "./App.css";
import WrappedRegistrationForm from "./components/signup";
import { BrowserRouter as Router, Switch, Link } from "react-router-dom";

function App() {
  return (
    <Switch>
      <Router path="/signup" component={WrappedRegistrationForm} />
    </Switch>
  );
}

export default App;
